public String[] getEventElements(String event) {
  if (event == null) {
    return null;
  }
  String[] elements = new String[MAX_EVENT_ELEMENTS];
  String str = null; // a string element if present (must be last)
  try {
    int firstQuoteIndex = event.indexOf('"');
    if (firstQuoteIndex >= 0) {
      // treat specially; has a string argument like "a comment\n
      // Note that the string is terminated by \n not end quote.
      // Easier to parse that way.
      String eventWithoutString = event.substring(0, firstQuoteIndex);
      str = event.substring(firstQuoteIndex + 1, event.length());
      event = eventWithoutString;
    }
    StringTokenizer st = new StringTokenizer(event, "\t", false);
    int i = 0;
    while (st.hasMoreTokens()) {
      if (i >= MAX_EVENT_ELEMENTS) {
        // ErrorManager.internalError("event has more than "+MAX_EVENT_ELEMENTS+" args: "+event);
        return elements;
      }
      elements[i] = st.nextToken();
      i++;
    }
    if (str != null) {
      elements[i] = str;
    }
  } catch (Exception e) {
    e.printStackTrace(System.err);
  }
  return elements;
}

/**
 * Extracts a long value from a string in a special manner. The string will be broken into tokens
 * with a standard StringTokenizer. Arround the assumed place (with the given half range) the
 * tokens are scaned reverse for a token which represents a long. if useNotIdentifier is not null,
 * tokens which are contains this string will be ignored. The first founded long returns.
 *
 * @param in the string which should be parsed
 * @param assumedPlace token number which should contain the value
 * @param halfRange half range for detection range
 * @param useNotIdentifier string which determines tokens which should be ignored
 * @return founded long
 */
private static long extractLong(
    String in, int assumedPlace, int halfRange, String useNotIdentifier) {
  long retval = -1;
  StringTokenizer st = new StringTokenizer(in);
  int length = st.countTokens();
  int i;
  int currentRange = 0;
  String[] interestedEntries = new String[halfRange + halfRange];
  for (i = 0; i < length - halfRange + assumedPlace; ++i) {
    st.nextToken(); // Forget this entries.
  }

  for (i = 0;
      i < halfRange + halfRange;
      ++i) { // Put the interesting Strings into an intermediaer array.
    if (st.hasMoreTokens()) {
      interestedEntries[i] = st.nextToken();
      currentRange++;
    }
  }

  for (i = currentRange - 1; i >= 0; --i) {
    if (useNotIdentifier != null && interestedEntries[i].indexOf(useNotIdentifier) > -1) {
      continue;
    }
    try {
      retval = Long.parseLong(interestedEntries[i]);
    } catch (NumberFormatException nfe) {
      continue;
    }
    break;
  }
  return retval;
}

