 * Retrieve the next set of records associated with the resumptionToken
 *
 * @param resumptionToken implementation-dependent format taken from the previous listRecords()
 *     Map result.
 * @return a Map object containing entries for "headers" and "identifiers" Iterators (both
 *     containing Strings) as well as an optional "resumptionMap" Map.
 * @exception BadResumptionTokenException the value of the resumptionToken argument is invalid or
 *     expired.
 */
public Map listRecords(String resumptionToken) throws BadResumptionTokenException {
  Map listRecordsMap = new HashMap();
  ArrayList records = new ArrayList();
  purge(); // clean out old resumptionTokens

  /**
   * ******************************************************************** YOUR CODE GOES HERE
   * ********************************************************************
   */
  /**
   * ******************************************************************** parse your
   * resumptionToken and look it up in the resumptionResults, if necessary
   * ********************************************************************
   */
  StringTokenizer tokenizer = new StringTokenizer(resumptionToken, ":");
  String resumptionId;
  int oldCount;
  String set;
  String metadataPrefix;
  try {
    resumptionId = tokenizer.nextToken();
    oldCount = Integer.parseInt(tokenizer.nextToken());
    set = tokenizer.nextToken();
    metadataPrefix = tokenizer.nextToken();
  } catch (NoSuchElementException e) {
    logger.info("No such element");
    throw new BadResumptionTokenException();
  }

  /* Get some more records from your database */
  Object[] nativeItem = (Object[]) resumptionResults.remove(resumptionId);
  if (nativeItem == null) {
    logger.info("nativeItem null");
    throw new BadResumptionTokenException();
  }
  int count;

  /* load the headers and identifiers ArrayLists. */
  for (count = 0; count < maxListSize && count + oldCount < nativeItem.length; ++count) {
    try {
      String record = constructRecord(nativeItem[count + oldCount], metadataPrefix);
      records.add(record);
    } catch (CannotDisseminateFormatException e) {
      /* the client hacked the resumptionToken beyond repair */
      logger.info("Cannot Disseminate Format " + nativeItem.toString() + count);
      throw new BadResumptionTokenException();
    }
  }

  /* decide if you're done */
  if (count + oldCount < nativeItem.length) {
    resumptionId = getResumptionId(set);

    /**
     * *************************************************************** Store an object appropriate
     * for your database API in the resumptionResults Map in place of nativeItems. This object
     * should probably encapsulate the information necessary to perform the next resumption of
     * ListIdentifiers. It might even be possible to encode everything you need in the
     * resumptionToken, in which case you won't need the resumptionResults Map. Here, I've done a
     * silly combination of the two. Stateless resumptionTokens have some advantages.
     * ***************************************************************
     */
    resumptionResults.put(resumptionId, nativeItem);

    /**
     * *************************************************************** Construct the
     * resumptionToken String however you see fit.
     * ***************************************************************
     */
    StringBuffer resumptionTokenSb = new StringBuffer();
    resumptionTokenSb.append(resumptionId);
    resumptionTokenSb.append(":");
    resumptionTokenSb.append(Integer.toString(oldCount + count));
    resumptionTokenSb.append(":");
    resumptionTokenSb.append(set);
    resumptionTokenSb.append(":");
    resumptionTokenSb.append(metadataPrefix);

    /**
     * *************************************************************** Use the following line if
     * you wish to include the optional resumptionToken attributes in the response. Otherwise, use
     * the line after it that I've commented out.
     * ***************************************************************
     */
    listRecordsMap.put(
        "resumptionMap",
        getResumptionMap(resumptionTokenSb.toString(), nativeItem.length, oldCount));
    // listRecordsMap.put("resumptionMap",
    // getResumptionMap(resumptionTokenSb.toString()));
  }
  /**
   * ********************************************************************* END OF CUSTOM CODE
   * SECTION *********************************************************************
   */
  listRecordsMap.put("records", records.iterator());
  return listRecordsMap;
}

