private static String getParent(String path) {
  logger.info("Getting parent of " + path);
  if (path == null || path.equals("/")) {
    logger.info("Returning NULL::" + path + " has no parent");
    return null;
  }
  StringTokenizer tokenizer = new StringTokenizer(path, "/");
  Vector<String> tokens = new Vector<String>();
  while (tokenizer.hasMoreElements()) tokens.add(tokenizer.nextToken());
  StringBuffer parentPathBuffer = new StringBuffer();
  if (tokens.size() == 1) parentPathBuffer.append("/");
  else
    for (int i = 0; i < tokens.size() - 1; i++)
      parentPathBuffer.append("/").append(tokens.elementAt(i));
  logger.info("Parent_path=" + parentPathBuffer.toString());
  return parentPathBuffer.toString();
}

public static String convertDefine(String in) {
  StringBuffer out = new StringBuffer();

  StringTokenizer tk = new StringTokenizer(in);
  while (tk.hasMoreElements()) {
    String token = tk.nextToken();

    // finds the define
    if (token.equals("#define")) {
      out.append(" public final static int ");
      out.append(tk.nextToken());
      out.append("= ");
      out.append(tk.nextToken());
      out.append(";\t");

      // append rest and out.
      while (tk.hasMoreElements()) {
        out.append(tk.nextToken());
        out.append(" ");
      }
    } else {
      out.append(token);
      out.append(" ");
    }
  }
  return out.toString();
}

