/**
 * Retrieve the next set of identifiers associated with the resumptionToken
 *
 * @param resumptionToken implementation-dependent format taken from the previous
 *     listIdentifiers() Map result.
 * @return a Map object containing entries for "headers" and "identifiers" Iterators (both
 *     containing Strings) as well as an optional "resumptionMap" Map.
 * @exception BadResumptionTokenException the value of the resumptionToken is invalid or expired.
 * @exception OAIInternalServerError signals an http status code 500 problem
 */
public Map listIdentifiers(String resumptionToken)
    throws BadResumptionTokenException, OAIInternalServerError {
  purge(); // clean out old resumptionTokens
  Map listIdentifiersMap = new HashMap();
  ArrayList headers = new ArrayList();
  ArrayList identifiers = new ArrayList();

  /**
   * ******************************************************************** parse your
   * resumptionToken and look it up in the resumptionResults, if necessary
   * ********************************************************************
   */
  StringTokenizer tokenizer = new StringTokenizer(resumptionToken, "!");
  String resumptionId;
  int oldCount;
  String metadataPrefix;
  int numRows;
  StatementResultSet stmtRs = null;
  try {
    resumptionId = tokenizer.nextToken();
    oldCount = Integer.parseInt(tokenizer.nextToken());
    numRows = Integer.parseInt(tokenizer.nextToken());
    metadataPrefix = tokenizer.nextToken();
  } catch (NoSuchElementException e) {
    throw new BadResumptionTokenException();
  }

  try {
    /* Get some more records from your database */
    stmtRs = (StatementResultSet) resumptionResults.get(resumptionId);
    if (stmtRs == null) {
      throw new BadResumptionTokenException();
    }
    int count;

    if (stmtRs.getRow() != oldCount) {
      // System.out.println("JDBCOAICatalog.listIdentifiers: reuse of old resumptionToken?");
      stmtRs.absolute(oldCount);
    }

    /* load the headers and identifiers ArrayLists. */
    for (count = 0; count < maxListSize && stmtRs.next(); ++count) {
      HashMap nativeItem = stmtRs.getColumnValues();
      /* Use the RecordFactory to extract header/identifier pairs for each item */
      Iterator setSpecs = getSetSpecs(nativeItem);
      String[] header = getRecordFactory().createHeader(nativeItem, setSpecs);
      headers.add(header[0]);
      identifiers.add(header[1]);
    }

    /* decide if you're done. */
    if (oldCount + count < numRows) {
      /**
       * *************************************************************** Construct the
       * resumptionToken String however you see fit.
       * ***************************************************************
       */
      StringBuffer resumptionTokenSb = new StringBuffer();
      resumptionTokenSb.append(resumptionId);
      resumptionTokenSb.append("!");
      resumptionTokenSb.append(Integer.toString(oldCount + count));
      resumptionTokenSb.append("!");
      resumptionTokenSb.append(Integer.toString(numRows));
      resumptionTokenSb.append("!");
      resumptionTokenSb.append(metadataPrefix);

      /**
       * *************************************************************** Use the following line if
       * you wish to include the optional resumptionToken attributes in the response. Otherwise,
       * use the line after it that I've commented out.
       * ***************************************************************
       */
      listIdentifiersMap.put(
          "resumptionMap", getResumptionMap(resumptionTokenSb.toString(), numRows, oldCount));
    } else {
      stmtRs.close();
      stmtRs = null;
    }
  } catch (SQLException e) {
    if (stmtRs != null) {
      try {
        stmtRs.close();
      } catch (SQLException e1) {
        e1.printStackTrace();
      }
    }
    e.printStackTrace();
    throw new OAIInternalServerError(e.getMessage());
  }

  listIdentifiersMap.put("headers", headers.iterator());
  listIdentifiersMap.put("identifiers", identifiers.iterator());
  return listIdentifiersMap;
}

/** @return true if host matches a host specified via the http.nonProxyHosts property */
private boolean matchNonProxyHosts(String host) {
  synchronized (getClass()) {
    String rawList =
        (String)
            java.security.AccessController.doPrivileged(
                new sun.security.action.GetPropertyAction("http.nonProxyHosts"));
    if (rawList == null) {
      nonProxyHostsPool = null;
    } else {
      if (!rawList.equals(nonProxyHostsSource)) {
        RegexpPool pool = new RegexpPool();
        StringTokenizer st = new StringTokenizer(rawList, "|", false);
        try {
          while (st.hasMoreTokens()) {
            pool.add(st.nextToken().toLowerCase(), Boolean.TRUE);
          }
        } catch (sun.misc.REException ex) {
          System.err.println("Error in http.nonProxyHosts system property: " + ex);
        }
        nonProxyHostsPool = pool;
      }
    }
    nonProxyHostsSource = rawList;
  }

  /*
   * Match against non-proxy hosts
   */
  if (nonProxyHostsPool == null) {
    return false;
  }
  if (nonProxyHostsPool.match(host) != null) {
    return true;
  } else {
    return false;
  }
}

