  DefaultMutableTreeNode tempNode = headOfMain;
  int n = 0;

  while (st.hasMoreTokens()) {
    curr = st.nextToken();
    int seq = Integer.parseInt(curr);
    if (n == 0) seq = seq + 1;
    if ((tempNode.getChildCount()) >= seq) {
      tempNode = (DefaultMutableTreeNode) tempNode.getChildAt(seq - 1);
    } else {
      tempNode.add(node);
      break;
    }
    n++;
  }
  return;
}

