/**
 * encode characters. "\n" -> "&nl;" "\r" -> "&cr;" "\f" -> "&lf;" ":" -> "&colon;" "|" ->
 * "&pipe;" "[" -> "&lbracket;" "]" -> "&rbracket;" "&" -> "&amp;" <br>
 * author: Thomas Behr 09-09-02
 *
 * @param s the String to encode
 * @return the encoded String
 */
public static String encode(String s) {
  final StringBuilder buffer = new StringBuilder();
  if (s != null) {
    final StringTokenizer tokens = new StringTokenizer(s, ENCODE, true);

    while (tokens.hasMoreTokens()) {
      buffer.append(ENTITIES.get(tokens.nextToken()));
    }
  }
  return buffer.toString();
}

/**
 * Tokenize the given String into a String array via a StringTokenizer.
 *
 * <p>The given delimiters string is supposed to consist of any number of delimiter characters.
 * Each of those characters can be used to separate tokens. A delimiter is always a single
 * character; for multi-character delimiters, consider using delimitedListToStringArray
 *
 * @param str the String to tokenize
 * @param delimiters the delimiter characters, assembled as String (each of those characters is
 *     individually considered as delimiter)
 * @param trimTokens trim the tokens via String's trim
 * @param ignoreEmptyTokens omit empty tokens from the result array (only applies to tokens that
 *     are empty after trimming; StringTokenizer will not consider subsequent delimiters as token
 *     in the first place).
 * @return an array of the tokens (null if the input String was null)
 */
public static String[] tokenizeToStringArray(
    String str, String delimiters, boolean trimTokens, boolean ignoreEmptyTokens) {
  if (str == null) {
    return null;
  }
  StringTokenizer st = new StringTokenizer(str, delimiters);
  List<String> tokens = new ArrayList<String>();
  while (st.hasMoreTokens()) {
    String token = st.nextToken();
    if (trimTokens) {
      token = token.trim();
    }
    if (!ignoreEmptyTokens || token.length() > 0) {
      tokens.add(token);
    }
  }
  return tokens.toArray(new String[tokens.size()]);
}

private final boolean compareVersions(
    String in,
    String template,
    boolean isMin,
    int assumedPlace,
    int halfRange,
    String useNotIdentifier) {
  StringTokenizer st = new StringTokenizer(in, " \t\n\r\f\"");
  int length = st.countTokens();
  int i;
  int currentRange = 0;
  String[] interestedEntries = new String[halfRange + halfRange];
  int praeScan = 0;
  praeScan = assumedPlace - halfRange;
  for (i = 0; i < assumedPlace - halfRange; ++i)
    if (st.hasMoreTokens()) st.nextToken(); // Forget this entries.

  for (i = 0;
      i < halfRange + halfRange;
      ++i) { // Put the interesting Strings into an intermediaer array.
    if (st.hasMoreTokens()) {
      interestedEntries[i] = st.nextToken();
      currentRange++;
    }
  }

  for (i = 0; i < currentRange; ++i) {
    if (useNotIdentifier != null && interestedEntries[i].indexOf(useNotIdentifier) > -1) continue;
    if (Character.getType(interestedEntries[i].charAt(0)) != Character.DECIMAL_DIGIT_NUMBER)
      continue;
    break;
  }
  if (i == currentRange) {
    detectedVersion = "<not found>";
    return (false);
  }
  detectedVersion = interestedEntries[i];
  StringTokenizer current = new StringTokenizer(interestedEntries[i], "._-");
  StringTokenizer needed = new StringTokenizer(template, "._-");
  while (needed.hasMoreTokens() && current.hasMoreTokens()) {
    String cur = current.nextToken();
    String nee = needed.nextToken();
    if (Integer.parseInt(cur) < Integer.parseInt(nee))
      if (isMin) return (false);
      else return (true);
    if (Integer.parseInt(cur) > Integer.parseInt(nee))
      if (isMin) return (true);
      else return (false);
  }
  return (true);
}

