public String process(final String input, final BufferedReader br, final PrintStream out) {
  if (out == null) throw new IllegalArgumentException("Must have an output PrintStream");
  StringTokenizer tok = new StringTokenizer(input);
  String deployment = null;
  DeployOptions deployOptions = new DeployOptions();
  deployOptions.deployTimeout = (Long) CLI.getInstance().settings.get(CLI.DEPLOY_WAIT);
  BufferedReader reader = br;
  boolean oarDeployment = false;

  if (tok.countTokens() > 1) {
    /* First token is "deploy" */
    tok.nextToken();
    /* Next token is the deploy-descriptor */
    // deployment = tok.nextToken();
    while (tok.hasMoreTokens()) {
      String value = tok.nextToken();
      if (value.endsWith(".xml") || value.endsWith(".groovy")) {
        /* value is the deploy-descriptor */
        deployment = value;
      } else if (value.endsWith("oar")) {
        /* value is the oar file */
        deployment = value;
        oarDeployment = true;
      } else if (value.startsWith("-t")) {
        StringTokenizer tok1 = new StringTokenizer(value, " =");
        if (tok1.countTokens() < 2) return (getUsage());
        /* First token will be "delay" */
        tok1.nextToken();
        /* Next token must be the timeout value */
        value = tok1.nextToken();
        try {
          deployOptions.deployTimeout = Long.parseLong(value);
        } catch (NumberFormatException e) {
          return (getUsage());
        }
      } else if (value.startsWith("-r")) {
        StringTokenizer tok1 = new StringTokenizer(value, " =");
        if (tok1.countTokens() < 2) return (getUsage());
        /* First token will be "-r" */
        tok1.nextToken();
        /* Next token must be the repositories value */
        value = tok1.nextToken();
        deployOptions.repositories = value;
      } else if (value.startsWith("-")) {
        /* strip the "-" off */
        value = value.substring(1);
        while (value.length() > 0) {
          if (value.startsWith("i")) {
            deployOptions.noPrompt = true;
          } else if (value.startsWith("u")) {
            deployOptions.update = true;
          } else if (value.startsWith("v")) {
            deployOptions.verbose = true;
          } else {
            return (getUsage());
          }
          value = value.substring(1);
        }
      } else {
        /* If its none of the above then we must have a
         * directory name to deploy */
        deployment = value;
        oarDeployment = true;
      }
    }
  } else {
    return (getUsage());
  }
  OperationalString deploy = null;
  if (!oarDeployment) {
    try {
      deploy = loadDeployment(deployment);
      if (deploy == null) {
        return (deployment + ": Cannot find file [" + deployment + "]\n");
      }
      if (deployOptions.repositories != null) {
        String[] parts = deployOptions.repositories.split(";");
        List<RemoteRepository> remoteRepositories = new ArrayList<RemoteRepository>();
        for (String part : parts) {
          RemoteRepository r = new RemoteRepository();
          r.setUrl(part);
          remoteRepositories.add(r);
        }
        for (ServiceElement service : deploy.getServices()) {
          service.setRemoteRepositories(remoteRepositories);
        }
      }
    } catch (Exception e) {
      e.printStackTrace();
      return ("Problem loading ["
          + deployment
          + "], Exception : "
          + e.getLocalizedMessage()
          + "\n");
    }
  }

  ServiceItem[] items =
      CLI.getInstance().finder.findMonitors(null, null, deployOptions.verbose);
  if (items.length == 0) return ("No Provision Monitor instances discovered\n");

  if (items.length == 1 || deployOptions.noPrompt()) {
    if (oarDeployment) {
      return (deploy(items[0], deployment, deployOptions, out));
    } else {
      return (deploy(items[0], deploy, deployOptions, reader, out));
    }
  }
  if (reader == null) reader = new BufferedReader(new InputStreamReader(System.in));
  out.println(Formatter.asList(items) + "\n");
  printRequest(out);
  while (true) {
    try {
      String response = reader.readLine();
      if (response == null) {
        break;
      }
      if (response.equals("c")) break;
      try {
        int num = Integer.parseInt(response);
        if (num < 1 || num > (items.length + 1)) {
          printRequest(out);
        } else {
          if (oarDeployment) {
            deploy(items[0], deployment, deployOptions, out);
          } else {
            deploy(items[num - 1], deploy, deployOptions, reader, out);
          }
          break;
        }
      } catch (NumberFormatException e) {
        out.println("Invalid choice [" + response + "]");
        printRequest(out);
      }
    } catch (IOException e) {
      e.printStackTrace();
    }
  }
  return ("");
}

/** Parses the output of winipcfg or ipconfig. */
private static void findWin(InputStream in) {
  BufferedReader br = new BufferedReader(new InputStreamReader(in));
  try {
    List lserver = new ArrayList();
    List lsearch = new ArrayList();
    String line = null;
    boolean readingServers = false;
    boolean readingSearches = false;
    while ((line = br.readLine()) != null) {
      StringTokenizer st = new StringTokenizer(line);
      if (!st.hasMoreTokens()) {
        readingServers = false;
        readingSearches = false;
        continue;
      }
      String s = st.nextToken();
      if (line.indexOf(":") != -1) {
        readingServers = false;
        readingSearches = false;
      }

      if (line.indexOf("Host Name") != -1) {
        while (st.hasMoreTokens()) s = st.nextToken();
        Name name;
        try {
          name = Name.fromString(s, null);
        } catch (TextParseException e) {
          continue;
        }
        if (name.labels() == 1) continue;
        addSearch(s, lsearch);
      } else if (line.indexOf("Primary Dns Suffix") != -1) {
        while (st.hasMoreTokens()) s = st.nextToken();
        if (s.equals(":")) continue;
        addSearch(s, lsearch);
        readingSearches = true;
      } else if (readingSearches || line.indexOf("DNS Suffix") != -1) {
        while (st.hasMoreTokens()) s = st.nextToken();
        if (s.equals(":")) continue;
        addSearch(s, lsearch);
        readingSearches = true;
      } else if (readingServers || line.indexOf("DNS Servers") != -1) {
        while (st.hasMoreTokens()) s = st.nextToken();
        if (s.equals(":")) continue;
        addServer(s, lserver);
        readingServers = true;
      }
    }

    if (servers == null && lserver.size() > 0)
      servers = (String[]) lserver.toArray(new String[lserver.size()]);
  } catch (IOException e) {
  } finally {
    try {
      br.close();
    } catch (IOException e) {
    }
  }
  return;
}

