/**
 * Creates the items that make up this field. Both separators and input fields are considered
 * items. The items created are stored in <code>items</code>. In addition, all fields are stored
 * in <code>inputFields</code>.
 *
 * @param format a string that specifies the layout of the input fields and separators.
 */
/*--------------------------------------------------------------------------*/
/*
 * $ @design
 *
 * I used a simple StringTokenizer to break the format string into individual tokens. The
 * approach in building up the field is to consider each token a potential definition for an
 * input field. Therefore I attempt to create an instance of FieldSpec from each token.
 * FieldSpec analyzes the token and if it does not represent a valid specification for an input
 * field throws an exception. If I catch an exception, I know the token does not represent a
 * valid field specification. In this case I treat the token as a separator, even though this
 * might not be what the user had intended. However, this approach allows me to implement robust
 * behavior (no exception thrown) even though the user might have made a mistake in the
 * definition. The mistake should become immediately obvious when testing the code, since a
 * input field definition would show up as separator between two fields.
 * --------------------------------------------------------------------------
 */
private void createItems(String format) {
  Object item;
  JTextField field;
  String token;
  FieldSpec spec;
  StringTokenizer tokenizer = new StringTokenizer(format);

  while (tokenizer.hasMoreTokens()) {
    token = tokenizer.nextToken();
    try {
      spec = new FieldSpec(token);
      field =
          new RuleTextField(
              spec.getColumns(),
              spec.getEditLength(),
              spec.getType(),
              spec.getUnlimitedEdit(),
              toolkit);

      // ------------------------------------------------
      // if the previous item is also a field, insert a
      // space as separator
      // ------------------------------------------------
      if (items.size() > 0) {
        item = items.lastElement();

        if (item instanceof JTextField) {
          items.add(" ");
        }
      }

      items.add(field);
      inputFields.add(field);
      field.addFocusListener(this);
      field.addKeyListener(this);
      field.addCaretListener(this);
    }
    // --------------------------------------------------
    // if we were not successful creating an input field,
    // the token must be a separator or the definition
    // has an error. Simply insert it as separator,
    // when testing the installer the error should become
    // obvious to the developer.
    // --------------------------------------------------
    catch (Throwable exception) {
      if (items.size() == 0) {
        items.add(token);
      } else {
        item = items.lastElement();

        // ----------------------------------------------
        // if the previous item is also a separator,
        // simply concatenate the token with a space
        // inserted in between, don't add it as new
        // separator.
        // ----------------------------------------------
        if (item instanceof String) {
          items.setElementAt(item + " " + token, (items.size() - 1));
        } else {
          items.add(token);
        }
      }
    }
  }

  // ----------------------------------------------------
  // add the fields and separators to the component
  // ----------------------------------------------------
  for (int i = 0; i < items.size(); i++) {
    item = items.elementAt(i);

    if (item instanceof String) {
      add(new JLabel((String) item));
    } else {
      add((JTextField) item);
    }
  }
}

protected Set<String> getFieldsAsSet(final String fields) {

  if (StringUtils.isEmpty(fields)) {
    return null;
  }

  final Set<String> filterProperties = new HashSet<String>();
  final StringTokenizer st = new StringTokenizer(fields, ",");
  while (st.hasMoreTokens()) {
    final String field = st.nextToken();

    // never allow 'userpassword' to be passed even if it was
    // specifically requested
    if (field.equals("userpassword")) {
      continue;
    }

    // add the field to the Set<String>
    filterProperties.add(field);
  }
  return filterProperties;
}

/**
 * Go through the properties, loading the shapefile, information file and attributes files, and
 * resolve how everything should be drawn. Might take awhile if the files are large. Called from
 * getRectangle, which is called when the AreaShapeLayer is added to the map.
 *
 * @param prefix property file entry header name
 * @param props the properties to look through.
 */
public void initialize(String prefix, Properties props) {

  if (props == null) {
    Debug.error(
        "AreaHandler: initialize received bad input:\n\tprefix: "
            + prefix
            + "\n\tproperties: "
            + (props == null ? "null" : "OK"));
    politicalAreas = null;
    return;
  }

  prefix = PropUtils.getScopedPropertyPrefix(prefix);

  politicalAreas = new Hashtable();

  // OK, Get the graphics. We are not expecting that all the
  // graphics in the file are not too much to handle. Also, we
  // test for the serialized graphics file first, and if it
  // isn't designated, then look for a shapefile and spatial
  // index file to create an OMGraphicsList.
  String cacheFile = props.getProperty(prefix + CacheFileProperty);

  // First find the resource, if not, then try as a file-URL...
  try {
    cacheURL = PropUtils.getResourceOrFileOrURL(this, cacheFile);

    if (cacheURL != null) {
      omgraphics = readCachedGraphics(cacheURL);
    } else {
      // We'll use the spatial index set from the
      // ShapeLayer.

      // Now, get the attribute file
      String dbfFile = props.getProperty(prefix + dbfFileProperty);
      URL dbfFileURL = null;
      if (dbfFile != null) {
        dbfFileURL = PropUtils.getResourceOrFileOrURL(this, dbfFile);
      }
      if (dbfFileURL != null) {
        InputStream is = dbfFileURL.openStream();
        dbfModel = new DbfTableModel(new DbfInputStream(is));
      }
      if (dbfModel == null) {
        String csvFile = props.getProperty(prefix + csvFileProperty);
        URL infofileURL = null;
        if (csvFile != null) {
          infofileURL = PropUtils.getResourceOrFileOrURL(this, csvFile);
        }

        // Read them in.
        if (infofileURL != null) {
          infoFile = new CSVShapeInfoFile(csvFile);
          infoFile.setHeadersExist(
              PropUtils.booleanFromProperties(props, prefix + csvHeaderProperty, true));
          infoFile.loadData(true);
        }
      }
    }
  } catch (java.net.MalformedURLException murle) {
    omgraphics = new OMGraphicList();
  } catch (java.io.IOException ioe) {
    omgraphics = new OMGraphicList();
  } catch (Exception exc) {
    omgraphics = new OMGraphicList();
  }

  // This is handled properly yet. The PoliticalArea should be
  // updated to handle URLs for area points, and have different
  // icons for different areas.
  // String defaultPointImageURLString =
  // props.getProperty(prefix + pointImageURLProperty);

  // Now, match the attributes to the graphics. Find the
  // indexes of the name and the search key. Also figure out
  // which areas have special coloring needs.
  keyIndex = PropUtils.intFromProperties(props, prefix + keyIndexProperty, keyIndex);
  nameIndex = PropUtils.intFromProperties(props, prefix + nameIndexProperty, nameIndex);
  String areas = props.getProperty(prefix + areasProperty);

  if (areas == null) areas = "";

  StringTokenizer tokenizer = new StringTokenizer(areas, " ");
  // All this uses the properties to set the individual colors
  // of any area
  String currentArea;

  while (tokenizer.hasMoreTokens()) {
    currentArea = tokenizer.nextToken();

    PoliticalArea newParams = new PoliticalArea(currentArea);

    if (Debug.debugging("areas")) {
      Debug.output("AreaHandler: setting SPECIALIZED attributes for \"" + newParams.id + "\"");
    }

    areasItems.addElement(currentArea);

    newParams.drawingAttributes =
        new DrawingAttributes(prefix + areasProperty + "." + currentArea, props);

    politicalAreas.put(newParams.id.toUpperCase().intern(), newParams);
  }

  if (Debug.debugging("areas")) {
    Debug.output("AreaHandler: finished initialization");
  }
}

protected Dimension getCardinality(Role role) {
  int from = 1, to = 1;

  if (role.getClientCardinality() != null) {
    String card = role.getClientCardinality().getStringValue();
    StringTokenizer tok = new StringTokenizer(card, ".");

    try {
      from = Integer.parseInt(map(tok.nextToken()));

      if (tok.hasMoreTokens()) {
        to = Integer.parseInt(map(tok.nextToken()));
      } else {
        to = from;
      }
    } catch (Exception e) {
      throw new RuntimeException("Invalid cardinality " + card);
    }
  } else {
    Role other = role.getOtherRole();

    if (other.isAggregate()) {
      from = 0;
      to = Integer.MAX_VALUE;
    }
  }

  return new Dimension(from, to);
}

/**
 * Parse an identity string. Handles both legacy and new (!) style identities.
 *
 * @param identityString
 * @return
 */
private Map<IdentityField, String> parseIdentityHeader(final String identityString) {
  Map<IdentityField, String> identity = new HashMap<IdentityField, String>();

  if (K9.DEBUG) Log.d(K9.LOG_TAG, "Decoding identity: " + identityString);

  if (identityString == null || identityString.length() < 1) {
    return identity;
  }

  if (identityString.charAt(0) == '!' && identityString.length() > 2) {
    Uri.Builder builder = new Uri.Builder();
    builder.encodedQuery(identityString.substring(1)); // Need to cut off the ! at the beginning.
    Uri uri = builder.build();
    for (IdentityField key : IdentityField.values()) {
      String value = uri.getQueryParameter(key.value());
      if (value != null) {
        identity.put(key, value);
      }
    }

    if (K9.DEBUG) Log.d(K9.LOG_TAG, "Decoded identity: " + identity.toString());

    // Sanity check our Integers so that recipients of this result don't have to.
    for (IdentityField key : IdentityField.getIntegerFields()) {
      if (identity.get(key) != null) {
        try {
          Integer.parseInt(identity.get(key));
        } catch (NumberFormatException e) {
          Log.e(K9.LOG_TAG, "Invalid " + key.name() + " field in identity: " + identity.get(key));
        }
      }
    }
  } else {
    // Legacy identity

    if (K9.DEBUG) Log.d(K9.LOG_TAG, "Got a saved legacy identity: " + identityString);
    StringTokenizer tokens = new StringTokenizer(identityString, ":", false);

    // First item is the body length. We use this to separate the composed reply from the quoted
    // text.
    if (tokens.hasMoreTokens()) {
      String bodyLengthS = Utility.base64Decode(tokens.nextToken());
      try {
        identity.put(IdentityField.LENGTH, Integer.valueOf(bodyLengthS).toString());
      } catch (Exception e) {
        Log.e(K9.LOG_TAG, "Unable to parse bodyLength '" + bodyLengthS + "'");
      }
    }
    if (tokens.hasMoreTokens()) {
      identity.put(IdentityField.SIGNATURE, Utility.base64Decode(tokens.nextToken()));
    }
    if (tokens.hasMoreTokens()) {
      identity.put(IdentityField.NAME, Utility.base64Decode(tokens.nextToken()));
    }
    if (tokens.hasMoreTokens()) {
      identity.put(IdentityField.EMAIL, Utility.base64Decode(tokens.nextToken()));
    }
  }

  return identity;
}

public static void logDecodedPdu(Pdu p) {
  // Split into max 80 character lines around comma delimited boundaries
  int i = 0;
  String pdustring = p.toString();
  StringBuffer line = new StringBuffer();
  String token = "";
  StringTokenizer st = new StringTokenizer(pdustring, ",");
  while (st.hasMoreElements()) {
    token = st.nextToken();
    if ((line.length() + token.length()) < 79) {
      if (i > 0) {
        line.append(",");
      }
      line.append(token);
      i++;
    } else {
      logger.info(line.toString());
      line = new StringBuffer();
      line.append(token);
      i = 1;
    }
  }
  if (line.length() > 0) logger.info(line.toString());
}

/** Show name and step# of current state within schedule */
/*public*/ String getScheduleStatus() {
  if (schedule == null || schedule == Schedule.NULL) {
    return " null";
  } else {
    String token = null;
    StringTokenizer st =
        new StringTokenizer(
            schedule.getReserved(Schedule.SCHEDULE_SOURCE), "/\\:"); // for *n*x, DOS, and Mac
    int count = st.countTokens();
    StringBuffer sb = new StringBuffer(" ");

    for (int i = 1; i <= count; ++i) {
      token = st.nextToken();
      if (i == (count - 3)) {
        sb.append(token).append("/");
      }
      if (i == count) {
        sb.append(token);
      }
    }
    sb.append("(").append(schedule.getReserved(Schedule.STARTING_STEP)).append(")");
    return sb.toString();
  }
}

public double read(String path) throws IOException {
  FileSystem fs = FileSystem.get(new Configuration());
  FileStatus[] files = fs.listStatus(new Path(path));

  for (FileStatus fileStat : files) {
    if (!fileStat.isFile()) continue;

    BufferedReader br = null;

    try {
      br = new BufferedReader(new InputStreamReader(fs.open(fileStat.getPath())));

      String line;
      while ((line = br.readLine()) != null) {
        StringTokenizer st = new StringTokenizer(line);
        String word;
        while (st.hasMoreTokens()) {
          word = st.nextToken();
          this.wordsRead++;
          this.wordLengthsRead += word.length();
          this.wordLengthsReadSquared += (long) Math.pow(word.length(), 2.0);
        }
      }

    } catch (IOException e) {
      System.out.println("Output could not be read!");
      throw e;
    } finally {
      br.close();
    }
  }

  double mean = (((double) this.wordLengthsRead) / ((double) this.wordsRead));
  mean = Math.pow(mean, 2.0);
  double term = (((double) this.wordLengthsReadSquared / ((double) this.wordsRead)));
  double stddev = Math.sqrt((term - mean));
  return stddev;
}

/**
 * Handle the -Q, -xQ, --objname, --xobjname, --view --invoke options.
 *
 * @param token - option token to handle
 * @param tokens - succeeding command arguments
 * @throws Exception
 */
protected void handleOption(String token, List<String> tokens) throws Exception {
  // If token is a additive predefined query define option
  if (token.startsWith("-Q")) {
    String key = token.substring(2);
    String value = "";
    int pos = key.indexOf("=");
    if (pos >= 0) {
      value = key.substring(pos + 1);
      key = key.substring(0, pos);
    }

    // If additive query
    String predefQuery = PREDEFINED_OBJNAME_QUERY.getProperty(key);
    if (predefQuery == null) {
      context.printException(new IllegalArgumentException("Unknown query object type: " + key));
      return;
    }
    String queryStr = JmxMBeansUtil.createQueryString(predefQuery, value);
    StringTokenizer queryTokens = new StringTokenizer(queryStr, COMMAND_OPTION_DELIMETER);
    while (queryTokens.hasMoreTokens()) {
      queryAddObjects.add(queryTokens.nextToken());
    }
    normaliseObjectName(queryAddObjects);
  } else if (token.startsWith("-xQ")) {
    // If token is a substractive predefined query define option
    String key = token.substring(3);
    String value = "";
    int pos = key.indexOf("=");
    if (pos >= 0) {
      value = key.substring(pos + 1);
      key = key.substring(0, pos);
    }

    // If subtractive query
    String predefQuery = PREDEFINED_OBJNAME_QUERY.getProperty(key);
    if (predefQuery == null) {
      context.printException(new IllegalArgumentException("Unknown query object type: " + key));
      return;
    }
    String queryStr = JmxMBeansUtil.createQueryString(predefQuery, value);
    StringTokenizer queryTokens = new StringTokenizer(queryStr, COMMAND_OPTION_DELIMETER);
    while (queryTokens.hasMoreTokens()) {
      querySubObjects.add(queryTokens.nextToken());
    }
    normaliseObjectName(querySubObjects);
  } else if (token.startsWith("--objname")) {
    // If token is an additive object name query option

    // If no object name query is specified, or next token is a new
    // option
    if (tokens.isEmpty() || ((String) tokens.get(0)).startsWith("-")) {
      context.printException(new IllegalArgumentException("Object name query not specified"));
      return;
    }

    StringTokenizer queryTokens =
        new StringTokenizer((String) tokens.remove(0), COMMAND_OPTION_DELIMETER);
    while (queryTokens.hasMoreTokens()) {
      queryAddObjects.add(queryTokens.nextToken());
    }
  } else if (token.startsWith("--xobjname")) {
    // If token is a substractive object name query option

    // If no object name query is specified, or next token is a new
    // option
    if (tokens.isEmpty() || ((String) tokens.get(0)).startsWith("-")) {
      context.printException(new IllegalArgumentException("Object name query not specified"));
      return;
    }

    StringTokenizer queryTokens =
        new StringTokenizer((String) tokens.remove(0), COMMAND_OPTION_DELIMETER);
    while (queryTokens.hasMoreTokens()) {
      querySubObjects.add(queryTokens.nextToken());
    }
  } else if (token.startsWith("--view")) {
    // If token is a view option

    // If no view specified, or next token is a new option
    if (tokens.isEmpty() || ((String) tokens.get(0)).startsWith("-")) {
      context.printException(new IllegalArgumentException("Attributes to view not specified"));
      return;
    }

    // Add the attributes to view
    Enumeration viewTokens =
        new StringTokenizer((String) tokens.remove(0), COMMAND_OPTION_DELIMETER);
    while (viewTokens.hasMoreElements()) {
      queryViews.add(viewTokens.nextElement());
    }
  } else if (token.startsWith("--invoke")) {

    if (tokens.isEmpty() || ((String) tokens.get(0)).startsWith("-")) {
      context.printException(
          new IllegalArgumentException("operation to invoke is not specified"));
      return;
    }

    // add op and params
    Enumeration viewTokens =
        new StringTokenizer((String) tokens.remove(0), COMMAND_OPTION_DELIMETER);
    while (viewTokens.hasMoreElements()) {
      opAndParams.add((String) viewTokens.nextElement());
    }

  } else {
    // Let super class handle unknown option
    super.handleOption(token, tokens);
  }
}

/**
 * Given a query string, return the value for a given key. Throws exception if key is not set.
 *
 * @param key The key to look up in query string.
 * @param queryString The query string to read key from.
 * @return The value of the given key.
 * @throws IllegallyFormattedQueryStringException If key is not set in query string, or if query
 *     string has bad format.
 */
public static String extractValueFromQueryStringAndKey(String key, String queryString)
    throws IllegallyFormattedQueryStringException {
  if (queryString == null) {
    queryString = "";
  }
  // Some players add a / to the query string. Strip it
  if (queryString.endsWith("/")) {
    queryString = queryString.substring(0, queryString.length() - 1);
  }
  StringTokenizer queryItems = new StringTokenizer(queryString, "&");
  while (queryItems.hasMoreTokens()) {
    String queryParameter = queryItems.nextToken();
    StringTokenizer paramTokenizer = new StringTokenizer(queryParameter, "=");
    if (paramTokenizer.countTokens() != 2) {
      // parameters not of the form a=b are ignored
      continue;
    }
    String currentKey = paramTokenizer.nextToken();
    String currentValue = paramTokenizer.nextToken();
    if (currentKey.equalsIgnoreCase(key)) {
      return currentValue;
    }
  }
  throw new IllegallyFormattedQueryStringException(
      "Expected key '" + key + "' not found in query string" + queryString + "'");
}

public static void refresh() {
  String s = System.getProperty("dnsjava.options");
  if (s != null) {
    StringTokenizer st = new StringTokenizer(s, ",");
    while (st.hasMoreTokens()) {
      String token = st.nextToken();
      int index = token.indexOf('=');
      if (index == -1) set(token);
      else {
        String option = token.substring(0, index);
        String value = token.substring(index + 1);
        set(option, value);
      }
    }
  }
}

/**
 * Returns an array parsed from inStr by the specified delimiter.
 *
 * @param inStr - The string to be parsed.
 * @param delimeter - The delimeter to use for parsing.
 * @return String[] - array from the parsed Strings
 */
public static String[] makeArray(final String inStr, final String delimeter) {
  final ArrayList<String> list = new ArrayList<String>();
  final StringTokenizer tokenizer = new StringTokenizer(inStr, delimeter);
  while (tokenizer.hasMoreTokens()) {
    final String token = tokenizer.nextToken();
    list.add(token);
  }
  final String[] result = new String[list.size()];
  final Iterator<String> ci = list.iterator();
  for (int i = 0; (i < result.length) && ci.hasNext(); i++) {
    result[i] = ci.next();
  }
  return result;
}

/**
 * @see
 *     org.eclipse.gmf.runtime.emf.core.edit.MEditingDomain#getSchemaToLocationMap(org.eclipse.emf.common.util.URI)
 */
public Map getSchemaToLocationMap(InputStream inputStream) throws IOException {

  Map requiredLocations = new HashMap();

  // create a buffer reader using the stream we just created
  BufferedReader bufferedReader = null;

  try {

    bufferedReader = new BufferedReader(new InputStreamReader(inputStream));

    String line;
    int indexOfSchemasLocations = -1;

    // read the file line by line
    while ((line = bufferedReader.readLine()) != null) {

      // try to find the schema's location line
      indexOfSchemasLocations =
          line.indexOf(XMLResource.XSI_NS + ":" + XMLResource.SCHEMA_LOCATION); // $NON-NLS-1$

      if (indexOfSchemasLocations != -1) {

        int schemaStart = line.indexOf("\"", indexOfSchemasLocations + 1); // $NON-NLS-1$

        int schemaEnd = line.indexOf("\"", schemaStart + 1); // $NON-NLS-1$

        String schemas = line.substring(schemaStart + 1, schemaEnd);

        // trimming the white spaces
        schemas = schemas.trim();
        StringTokenizer st = new StringTokenizer(schemas);

        while (st.hasMoreTokens()) {

          String schema = st.nextToken();
          String requiredLocation = ""; // $NON-NLS-1$

          if (st.hasMoreTokens()) requiredLocation = st.nextToken();

          int hashLocation = requiredLocation.indexOf("#"); // $NON-NLS-1$

          if (hashLocation != -1) requiredLocation = requiredLocation.substring(0, hashLocation);

          if (requiredLocation.length() > 0)
            requiredLocations.put(schema, URI.decode(requiredLocation));
        }

        break;
      }
    }

  } finally {

    if (bufferedReader != null) bufferedReader.close();
  }

  return requiredLocations;
}

/**
 * Resolves the dependencies for a Profile.
 *
 * @param attr a group of attributes in the MANIFEST file for this JAR
 * @return the set of defined profiles
 */
private Set<String> loadManifestDependenciesForProfile(Attributes attr) {
  Set<String> ret = new HashSet<String>();
  String value = attr.getValue("Depends-on");
  if (value != null) {
    StringTokenizer st = new StringTokenizer(value, ",");

    while (st.hasMoreElements()) {
      String entry = st.nextToken().trim();
      ret.add(entry);
    }
  }

  return ret;
}

