  while (st.hasMoreTokens()) {
    returnList.add(st.nextToken());
  }

  if (returnList.size() > 0) {
    String[] stringArray = new String[returnList.size()];
    stringArray = returnList.toArray(stringArray);
    return stringArray;
  }
  return null;
