/**
 * Get a transform defined in the XML
 *
 * @param element The element from which the transform should be read
 * @param attribute The name of the attribute holding the transform
 * @return The transform to be applied
 */
static Transform getTransform(Element element, String attribute) {
  String str = element.getAttribute(attribute);
  if (str == null) {
    return new Transform();
  }

  if (str.equals("")) {
    return new Transform();
  } else if (str.startsWith("translate")) {
    str = str.substring(0, str.length() - 1);
    str = str.substring("translate(".length());
    StringTokenizer tokens = new StringTokenizer(str, ", ");
    float x = Float.parseFloat(tokens.nextToken());
    float y = Float.parseFloat(tokens.nextToken());

    return Transform.createTranslateTransform(x, y);
  } else if (str.startsWith("matrix")) {
    float[] pose = new float[6];
    str = str.substring(0, str.length() - 1);
    str = str.substring("matrix(".length());
    StringTokenizer tokens = new StringTokenizer(str, ", ");
    float[] tr = new float[6];
    for (int j = 0; j < tr.length; j++) {
      tr[j] = Float.parseFloat(tokens.nextToken());
    }

    pose[0] = tr[0];
    pose[1] = tr[2];
    pose[2] = tr[4];
    pose[3] = tr[1];
    pose[4] = tr[3];
    pose[5] = tr[5];

    return new Transform(pose);
  }

  return new Transform();
}

public static int parseCSeqNumber(String cseqHeader) {
  int cseq = -1;
  if (cseqHeader == null) {
    return cseq;
  }
  StringTokenizer cseqToken = new StringTokenizer(cseqHeader.trim());
  if (cseqToken.hasMoreTokens()) {
    try {
      cseq = Integer.parseInt(cseqToken.nextToken());
    } catch (NumberFormatException e) {
      cseq = -1;
    }
  }
  return cseq;
}

@Override
public void execute(Tuple input, BasicOutputCollector collector) {
  String tweet = input.getStringByField("tweet");
  String tweetId = input.getStringByField("tweet_id");
  StringTokenizer strTok = new StringTokenizer(tweet, " ");
  TransactionAttempt tx = (TransactionAttempt) input.getValueByField("txid");
  HashSet<String> users = new HashSet<String>();

  while (strTok.hasMoreTokens()) {
    String user = strTok.nextToken();

    // Ensure that the current word is a user, and that it's not
    // repeated in this tweet.
    if (user.startsWith("@") && !users.contains(user)) {
      collector.emit("users", new Values(tx, tweetId, user));
      users.add(user);
    }
  }
}

/**
 * Parse a query. A query string is any number of parameter-value clauses separated by any
 * non-zero number of ampersands. A parameter-value clause is a parameter followed by an equal
 * sign, followed by a value. If the equal sign is missing, the value is assumed to be the empty
 * string.
 *
 * @param query the query to parse.
 */
public void parseQuery(String query) {
  clear();
  // Split by '&'
  StringTokenizer tokenizer = new StringTokenizer(query, "&");
  while (tokenizer.hasMoreElements()) {
    String attributeValuePair = tokenizer.nextToken();
    if (attributeValuePair.length() > 0) {
      int assignmentIndex = attributeValuePair.indexOf('=');
      if (assignmentIndex < 0) {
        // No assignment found, treat as if empty value
        parseEntry(attributeValuePair, "");
      } else {
        parseEntry(
            attributeValuePair.substring(0, assignmentIndex),
            attributeValuePair.substring(assignmentIndex + 1));
      }
    }
  }
}

/** Extract the lat, long data from the data buffer */
protected void extractLtLgData() {

  /**
   * This method creates the XML tags that deal with polygon data and includes the polygon data in
   * it.
   *
   * @param id
   * @param data
   * @return
   */
  int offset = 0;
  final int INVALID = -10000000;
  double lt = INVALID;
  double lg = INVALID;

  switch (_level) {
    case DataTypes.LEVEL_0:
      offset = 2;
      break;

    case DataTypes.LEVEL_1:
      offset = 3;
      break;

    case DataTypes.LEVEL_2:
      offset = 4;
      break;
  }

  // Tokenize
  StringTokenizer tokens = new StringTokenizer(_data, ","); // $NON-NLS-1$

  // Advance the first K-tokens.
  for (int i = 0; i < offset; i++) {
    if (tokens.hasMoreTokens()) {
      tokens.nextToken();
    }
  }

  // We are now located at the beginning of the polygon data.
  while (tokens.hasMoreTokens()) {

    String token = tokens.nextToken();

    if (isNumeric(token) == false) {
      continue; // Ignore, this is not a valid coordinate.
    }

    if (lt == INVALID) {
      lt = getDouble(token);
    } else if (lg == INVALID) {
      lg = getDouble(token);
    }

    if (lt != INVALID && lg != INVALID) {
      // PointData point = new PointData(toDegrees(lt),
      // toDegrees(lg));
      PointData point = new PointData(lt, lg);
      if (init == null) {
        init = point;
      }
      last = point;
      // Eliminate repeated points : for every new point, add to list
      // only if it is not duplicated
      // if (checkDuplicatedPoints(point) == false) {
      list.add(point);
      // }
      lt = INVALID;
      lg = INVALID;
    }
  }
} // extractLtLgData

