private List<URI> findArtifactRepos() {
  List<URI> artifactRepos = new ArrayList<URI>();
  File p2Directory = findP2Directory();

  // Add the profile registry's default agent artifact repository.
  // Currently this is used by the Native Touchpoint to store artifacts however
  // other touchpoints might use this as well.
  File agentArtifactRepository = findAgentArtifactRepositoryDirectory(p2Directory);
  if (agentArtifactRepository != null) artifactRepos.add(agentArtifactRepository.toURI());

  // bundle pool
  String bundlePool = profile.getProperty(IProfile.PROP_CACHE);
  if (bundlePool != null) {
    File bundlePoolFile = new File(bundlePool);
    if (bundlePoolFile.exists()) artifactRepos.add(bundlePoolFile.toURI());
    else if (Boolean.valueOf(profile.getProperty(IProfile.PROP_ROAMING)).booleanValue()) {
      // the profile has not been used yet but is a roaming profile
      // best effort to add "just" the default bundle pool
      bundlePoolFile = findDefaultBundlePool(p2Directory);
      if (bundlePoolFile != null) artifactRepos.add(bundlePoolFile.toURI());
      return artifactRepos;
    }
  }

  // shared bundle pool
  String sharedBundlePool = profile.getProperty(IProfile.PROP_SHARED_CACHE);
  if (sharedBundlePool != null) artifactRepos.add(new File(sharedBundlePool).toURI());

  // cache extensions
  // Currently set exclusively by dropins
  String dropinRepositories =
      profile.getProperty("org.eclipse.equinox.p2.cache.extensions"); // $NON-NLS-1$
  if (dropinRepositories != null) {
    StringTokenizer tokenizer = new StringTokenizer(dropinRepositories, "|"); // $NON-NLS-1$
    while (tokenizer.hasMoreTokens()) {
      String repoLocation = ""; // $NON-NLS-1$
      try {
        repoLocation = tokenizer.nextToken();
        artifactRepos.add(new URI(repoLocation));
      } catch (URISyntaxException e) {
        LogHelper.log(
            new Status(
                IStatus.WARNING,
                EngineActivator.ID,
                "invalid repo reference with location: " + repoLocation,
                e)); // $NON-NLS-1$
      }
    }
  }
  return artifactRepos;
}

/**
 * Returns a comma-delimitted list of strings into a Collection of Strings.
 *
 * @param str the String.
 * @return a list.
 */
private List<JID> stringToList(String str) {
  List<JID> values = new ArrayList<JID>();
  StringTokenizer tokens = new StringTokenizer(str, ",");
  while (tokens.hasMoreTokens()) {
    String value = tokens.nextToken().trim();
    if (!value.equals("")) {
      // See if this is a full JID or just a username.
      if (value.contains("@")) {
        values.add(new JID(value));
      } else {
        values.add(XMPPServer.getInstance().createJID(value, null));
      }
    }
  }
  return values;
}

private Set getServiceComponents(String orgName, String path, boolean b)
    throws SMSException, SSOException {
  ServiceConfig sc =
      (orgName.equals(_rootDN))
          ? _smapi.getGlobalConfig(null)
          : _smapi.getOrganizationConfig(orgName, null);
  if (sc == null) {
    return new HashSet();
  }

  // Parser the "/" seperated path to get the right service config
  StringTokenizer st = new StringTokenizer(path, "/");
  while (st.hasMoreTokens()) {
    String token = st.nextToken();
    if ((token.length() == 0) || (token.length() == 0)) {
      continue;
    }
    sc = sc.getSubConfig(token);
  }
  Set answer = new HashSet();
  Iterator comps = sc.getSubConfigNames().iterator();
  while (comps.hasNext()) {
    answer.add(path + "/" + comps.next());
  }
  return (answer);
}

/** Breaks the specified string into an array of ints. Returns null if there is an error. */
public int[] s2ints(String s) {
  StringTokenizer st = new StringTokenizer(s, ", \t");
  int nInts = st.countTokens();
  if (nInts == 0) return null;
  int[] ints = new int[nInts];
  for (int i = 0; i < nInts; i++) {
    try {
      ints[i] = Integer.parseInt(st.nextToken());
    } catch (NumberFormatException e) {
      return null;
    }
  }
  return ints;
}

/**
 * Parses the accept-language header to obtain a vector of preferred locales
 *
 * @return the preferred locales, sorted by qvalue
 */
private Vector<Locale> getPreferredLocales() {
  if (_locales == null) {
    _locales = new Vector<Locale>();
    String languages = getHeader("accept-language");
    if (languages == null) {
      _locales.add(Locale.getDefault());
    } else {
      StringTokenizer st = new StringTokenizer(languages, ",");
      ArrayList<PrioritizedLocale> al = new ArrayList<PrioritizedLocale>();
      while (st.hasMoreTokens()) {
        String token = st.nextToken();
        al.add(new PrioritizedLocale(token));
      }
      Collections.sort(al);
      for (Iterator<PrioritizedLocale> iterator = al.iterator(); iterator.hasNext(); ) {
        _locales.add(iterator.next().getLocale());
      }
    }
  }
  return _locales;
}

