    StringTokenizer st = new StringTokenizer(s, "\n");

    for (int i = 0; i < level; i++) st.nextToken();

    String line = st.nextToken();
    int begin = line.indexOf("at ") + 3;
    String result = line.substring(begin);

    return result;

  } catch (Exception ex) {
    return "Error getting location: " + ex;
  }
}

