public static List<Concept> conceptListHelper(String descriptor) {
  List<Concept> ret = new ArrayList<Concept>();
  if (descriptor == null || descriptor.length() == 0) return ret;
  ConceptService cs = Context.getConceptService();

  for (StringTokenizer st = new StringTokenizer(descriptor, "|"); st.hasMoreTokens(); ) {
    String s = st.nextToken().trim();
    boolean isSet = s.startsWith("set:");
    if (isSet) s = s.substring(4).trim();
    Concept c = null;
    if (s.startsWith("name:")) {
      String name = s.substring(5).trim();
      c = cs.getConceptByName(name);
    } else {
      try {
        c = cs.getConcept(Integer.valueOf(s.trim()));
      } catch (Exception ex) {
      }
    }
    if (c != null) {
      if (isSet) {
        List<Concept> inSet = cs.getConceptsByConceptSet(c);
        ret.addAll(inSet);
      } else {
        ret.add(c);
      }
    }
  }
  return ret;
}

/**
 * Converts the given list of comma-delimited regex patterns to an array of Pattern objects
 *
 * @param list The comma-separated list of patterns
 * @exception IllegalArgumentException if one of the patterns has invalid regular expression
 *     syntax
 */
protected Pattern[] getRegExPatterns(String list) {

  if (list == null) return EMPTY_PATTERN;

  list = list.trim();
  if (list.length() < 1) return EMPTY_PATTERN;

  StringTokenizer st = new StringTokenizer(list, ",");

  ArrayList patterns = new ArrayList();
  while (st.hasMoreTokens()) {
    String token = st.nextToken().trim();
    try {
      // Host names are case insensitive
      patterns.add(Pattern.compile(token, Pattern.CASE_INSENSITIVE));
    } catch (PatternSyntaxException e) {
      throw new IllegalArgumentException(
          "Illegal Regular Expression Syntax: [" + token + "] - " + e.getMessage());
    }
  }
  return ((Pattern[]) patterns.toArray(EMPTY_PATTERN));
}

/**
 * Static method to extract the list of paths out of a String. The format of the String is:
 * <path1><PATH_SEPARATOR><path2>... Only correct paths are added to the later returned list.
 *
 * @param pathList the String the paths will be extracted from.
 * @return an array of all valid paths. If the given parameter contains no path or none of the
 *     given paths is valid then an empty list is returned.
 */
public static URL[] parseClassPath(String pathList) {

  List<URL> pathURLS = new ArrayList<URL>();

  StringTokenizer tok = new StringTokenizer(pathList, PATH_SEPARATOR, false);
  while (tok.hasMoreTokens()) {
    String fileName = tok.nextToken();
    File file = new File(fileName);
    try {
      pathURLS.add(file.toURI().toURL());
    } catch (MalformedURLException bad) {
      // ignored
    }
  }

  return pathURLS.toArray(new URL[pathURLS.size()]);
}

/**
 * Searches for entities which comply to the current search specification and stores them as
 * results.
 */
@Override
protected void find(boolean findMore) {
  BestMatchFinder bmf = new BestMatchFinder(pattern);
  List<MapEntity> results = getResults();
  BoundingBox bb = new BoundingBox(position, nextRadius);
  if (!results.isEmpty()) bmf.checkMatchQuality(results.get(0));
  if (mode.equals(Mode.ENTITY) || mode.equals(Mode.NODE)) {
    for (MapNode node : getStorage().getPois(bb)) {
      int match = bmf.checkMatchQuality(node);
      if (match >= 0) {
        if (match > 0) {
          results.clear();
          bmf.useAsReference(node);
        }
        if (position.insertInAscendingDistanceOrder(results, node))
          if (results.size() > 100) results.remove(99);
      }
    }
  }
  if (mode.equals(Mode.ENTITY) || mode.equals(Mode.WAY)) {
    for (MapWay way : getStorage().getWays(bb)) {
      int match = bmf.checkMatchQuality(way);
      if (match >= 0) {
        if (match > 0) {
          results.clear();
          bmf.useAsReference(way);
        }
        if (position.insertInAscendingDistanceOrder(results, way))
          if (results.size() > 100) results.remove(99);
      }
    }
  }

  if (mode.equals(Mode.ADDRESS)) {
    List<MapEntity> iResults = getIntermediateResults();
    StringTokenizer tokenizer = new StringTokenizer(pattern, ",");
    String placeName = null;
    String wayName = null;
    if (tokenizer.hasMoreElements()) placeName = tokenizer.nextToken();
    if (tokenizer.hasMoreElements()) wayName = tokenizer.nextToken().trim();

    if (placeName != null && !findMore) {
      for (MapNode place : getStorage().getPlaces(placeName)) {
        position.insertInAscendingDistanceOrder(iResults, place);
        if (iResults.size() > 100) iResults.remove(99);
      }
      nextRadius = -1;
    }
    if (iResults.size() == 1 && wayName != null) {
      MapNode place = (MapNode) iResults.get(0);
      findWay(wayName, new Position(place.getLat(), place.getLon()), null);
    }

  } else {
    nextRadius *= 2;
    if (results.isEmpty() && getIntermediateResults().isEmpty() && nextRadius <= getMaxRadius())
      find(true);
  }
}

/**
 * Parse a location string and return a CVSRepositoryLocation.
 *
 * <p>The valid format (from the cederqvist) is:
 *
 * <p>:method:[[user][:password]@]hostname[:[port]]/path/to/repository
 *
 * <p>However, this does not work with CVS on NT so we use the format
 *
 * <p>:method:[user[:password]@]hostname[#port]:/path/to/repository
 *
 * <p>Some differences to note: The : after the host/port is not optional because of NT naming
 * including device e.g. :pserver:username:password@hostname#port:D:\cvsroot
 *
 * <p>Also parse alternative format from WinCVS, which stores connection parameters such as
 * username and hostname in method options:
 *
 * <p>:method[;option=arg...]:other_connection_data
 *
 * <p>e.g. :pserver;username=anonymous;hostname=localhost:/path/to/repository
 *
 * <p>If validateOnly is true, this method will always throw an exception. The status of the
 * exception indicates success or failure. The status of the exception contains a specific message
 * suitable for displaying to a user who has knowledge of the provided location string.
 *
 * @see CVSRepositoryLocation.fromString(String)
 */
public static CVSRepositoryLocation fromString(String location, boolean validateOnly)
    throws CVSException {
  String errorMessage = null;
  try {
    // Get the connection method
    errorMessage = CVSMessages.CVSRepositoryLocation_parsingMethod;
    int start = location.indexOf(COLON);
    String methodName;
    int end;
    // For parsing alternative location format
    int optionStart = location.indexOf(SEMICOLON);
    HashMap<String, String> hmOptions = new HashMap<>();

    if (start == 0) {
      end = location.indexOf(COLON, start + 1);

      // Check for alternative location syntax
      if (optionStart != -1) {
        // errorMessage = CVSMessages.CVSRepositoryLocation_parsingMethodOptions;
        methodName = location.substring(start + 1, optionStart);
        // Save options in hash table
        StringTokenizer stOpt =
            new StringTokenizer(
                location.substring(optionStart + 1, end), "=;" // $NON-NLS-1$
                );
        while (stOpt.hasMoreTokens()) {
          hmOptions.put(stOpt.nextToken(), stOpt.nextToken());
        }
        start = end + 1;
      } else {
        methodName = location.substring(start + 1, end);
        start = end + 1;
      }
    } else {
      // this could be an alternate format for ext: username:password@host:path
      methodName = "ext"; // $NON-NLS-1$
      start = 0;
    }

    IConnectionMethod method = getPluggedInConnectionMethod(methodName);
    if (method == null)
      throw new CVSException(
          new CVSStatus(
              IStatus.ERROR,
              NLS.bind(
                  CVSMessages.CVSRepositoryLocation_methods,
                  (new Object[] {getPluggedInConnectionMethodNames()})))); //

    // Get the user name and password (if provided)
    errorMessage = CVSMessages.CVSRepositoryLocation_parsingUser;
    // Since there is a @ sign in the user name so use lastIndexOf to get to the host separator @
    end = location.lastIndexOf(HOST_SEPARATOR, location.length());
    String user = null;
    String password = null;
    // if end is -1 then there is no host separator meaning that the username is not present
    // or set in options of alternative-style location string
    if (end != -1) {
      // Get the optional user and password
      user = location.substring(start, end);
      // Separate the user and password (if there is a password)
      start = user.indexOf(COLON);
      if (start != -1) {
        errorMessage = CVSMessages.CVSRepositoryLocation_parsingPassword;
        password = user.substring(start + 1);
        user = user.substring(0, start);
      }
      // Set start to point after the host separator
      start = end + 1;
    } else if (optionStart != -1) {
      // alternative location string data
      // errorMessage = CVSMessages.CVSRepositoryLocation_parsingOptionsUsername;
      if (hmOptions.containsKey("username"))
        user = hmOptions.get("username").toString(); // $NON-NLS-1$ //$NON-NLS-2$
      // errorMessage = CVSMessages.CVSRepositoryLocation_parsingOptionsPassword;
      if (hmOptions.containsKey("password"))
        password = hmOptions.get("password").toString(); // $NON-NLS-1$ //$NON-NLS-2$
    }

    // Get the host (and port)
    errorMessage = CVSMessages.CVSRepositoryLocation_parsingHost;
    end = location.indexOf(COLON, start);
    int hostEnd = end;
    if (end == -1) {
      // The last colon is optional so look for the slash that starts the path
      end = location.indexOf('/', start);
      hostEnd = end;
      // Decrement the end since the slash is part of the path
      if (end != -1) end--;
    }
    String host =
        (hmOptions.containsKey("hostname"))
            ? hmOptions.get("hostname").toString()
            : location.substring(start, hostEnd); // $NON-NLS-1$ //$NON-NLS-2$
    int port = USE_DEFAULT_PORT;
    boolean havePort = false;
    if (hmOptions.containsKey("port")) { // $NON-NLS-1$
      port = Integer.parseInt(hmOptions.get("port").toString()); // $NON-NLS-1$
      havePort = true;
    }
    // Separate the port and host if there is a port
    start = host.indexOf(PORT_SEPARATOR);
    if (start != -1) {
      try {
        // Initially, we used a # between the host and port
        errorMessage = CVSMessages.CVSRepositoryLocation_parsingPort;
        port = Integer.parseInt(host.substring(start + 1));
        host = host.substring(0, start);
        havePort = true;
      } catch (NumberFormatException e) {
        // Ignore this as the #1234 port could be part of a proxy host string
      }
    }
    if (!havePort) {
      // In the correct CVS format, the port follows the COLON
      errorMessage = CVSMessages.CVSRepositoryLocation_parsingPort;
      int index = end;
      char c = location.charAt(++index);
      String portString = new String();
      while (Character.isDigit(c)) {
        portString += c;
        c = location.charAt(++index);
      }
      if (portString.length() > 0) {
        end = index - 1;
        port = Integer.parseInt(portString);
      }
    }

    // Get the repository path (translating backslashes to slashes)
    errorMessage = CVSMessages.CVSRepositoryLocation_parsingRoot;
    start = end + 1;
    String root = location.substring(start);

    if (validateOnly) throw new CVSException(new CVSStatus(IStatus.OK, CVSMessages.ok)); //
    return new CVSRepositoryLocation(
        method,
        user,
        password,
        host,
        port,
        root,
        null /* encoding */,
        (user != null),
        (password != null));
  } catch (IndexOutOfBoundsException e) {
    // We'll get here if anything funny happened while extracting substrings
    IStatus status = new CVSStatus(IStatus.ERROR, errorMessage);
    throw new CVSException(status);
  } catch (NumberFormatException e) {
    IStatus status = new CVSStatus(IStatus.ERROR, errorMessage);
    // We'll get here if we couldn't parse a number
    throw new CVSException(status);
  }
}

/**
 * Loads the ASCII specification of this FSM from the given InputStream.
 *
 * @param is the input stream to load from
 * @throws IOException if an error occurs on input.
 */
private void loadText(InputStream is) throws IOException {
  BufferedReader reader = new BufferedReader(new InputStreamReader(is));
  String line = null;
  while ((line = reader.readLine()) != null) {
    if (!line.startsWith("***")) {
      if (line.startsWith(VOCAB_SIZE)) {
        vocabularySize = parseLastInt(line);
      } else if (line.startsWith(NUM_OF_TRANSITIONS)) {
        int transitionsSize = parseLastInt(line);
        transitions = new int[transitionsSize];
      } else if (line.startsWith(TRANSITIONS)) {
        StringTokenizer st = new StringTokenizer(line);
        String transition = st.nextToken();
        int i = 0;
        while (st.hasMoreTokens() && i < transitions.length) {
          transition = st.nextToken().trim();
          transitions[i++] = Integer.parseInt(transition);
        }
      }
    }
  }
  reader.close();
}

