/**
 * Check for presence of the process with the pid passed is alive or not currently.
 *
 * @param pid pid of the process
 * @return if a process is alive or not.
 */
private static boolean isAlive(String pid) throws IOException {
  String commandString = "ps -o pid,command -e";
  String args[] = new String[] {"bash", "-c", commandString};
  ShellCommandExecutor shExec = new ShellCommandExecutor(args);
  try {
    shExec.execute();
  } catch (ExitCodeException e) {
    return false;
  } catch (IOException e) {
    LOG.warn(
        "IOExecption thrown while checking if process is alive"
            + StringUtils.stringifyException(e));
    throw e;
  }

  String output = shExec.getOutput();

  // Parse the command output and check for pid, ignore the commands
  // which has ps or grep in it.
  StringTokenizer strTok = new StringTokenizer(output, "\n");
  boolean found = false;
  while (strTok.hasMoreTokens()) {
    StringTokenizer pidToken = new StringTokenizer(strTok.nextToken(), " ");
    String pidStr = pidToken.nextToken();
    String commandStr = pidToken.nextToken();
    if (pid.equals(pidStr) && !(commandStr.contains("ps") || commandStr.contains("grep"))) {
      found = true;
      break;
    }
  }
  return found;
}

protected String getPingPage(String url) {
  int pos = url.indexOf(' ');

  if (pos != -1) {

    url = url.substring(0, pos);
  }

  pos = url.indexOf('?');

  Map response = new HashMap();

  boolean ok = false;

  if (pos != -1) {

    StringTokenizer tok = new StringTokenizer(url.substring(pos + 1), "&");

    while (tok.hasMoreTokens()) {

      String token = tok.nextToken();

      pos = token.indexOf('=');

      if (pos != -1) {

        String lhs = token.substring(0, pos);
        String rhs = token.substring(pos + 1);

        if (lhs.equals("check")) {

          response.put("check", rhs);

          ok = true;
        }
      }
    }
  }

  if (ok) {

    try {
      byte[] bytes = BEncoder.encode(response);

      byte[] length = new byte[4];

      ByteBuffer.wrap(length).putInt(bytes.length);

      return ("HTTP/1.1 200 OK"
          + NL
          + "Connection: Close"
          + NL
          + "Content-Length: "
          + (bytes.length + 4)
          + NL
          + NL
          + new String(length, "ISO-8859-1")
          + new String(bytes, "ISO-8859-1"));

    } catch (Throwable e) {
    }
  }

  return (getNotFound());
}

/**
 * Process the export keyword
 *
 * @return true on success, false on error.
 */
private boolean processExport(StringTokenizer str) {
  String keyWord;
  PadExports pe = new PadExports();
  pe.lineno = lineno;
  pe.padname = null;
  pe.corename = null;

  keyWord = str.nextToken();
  if (keyWord.equals("")) {
    System.out.println("Line " + lineno + ": missing 'cell' name");
    return false;
  }
  pe.cellname = keyWord;

  if (str.hasMoreTokens()) {
    keyWord = str.nextToken();
    pe.padname = keyWord;
    if (str.hasMoreTokens()) {
      keyWord = str.nextToken();
      pe.corename = keyWord;
    }
  }
  exports.put(pe.cellname, pe);
  return true;
}

/**
 * Loads images from the specified dir, scales to specified resolution and creates RGB data for
 * each image Puts RGB data in a Map using filenames as keys, and rerurns that amp
 *
 * @param imgDir
 * @param samplingResolution
 * @return
 * @throws java.io.IOException
 */
public static Map<String, FractionRgbData> getFractionRgbDataForDirectory(
    File imgDir, Dimension samplingResolution) throws IOException {
  if (!imgDir.isDirectory()) {
    throw new IOException("The given file must be a directory. Argument is: " + imgDir);
  }

  Map<String, FractionRgbData> rgbDataMap = new HashMap<String, FractionRgbData>();

  ImagesIterator imagesIterator = new ImagesIterator(imgDir);
  while (imagesIterator.hasNext()) {
    BufferedImage img = imagesIterator.next();
    img = ImageSampler.downSampleImage(samplingResolution, img);
    String filenameOfCurrentImage = imagesIterator.getFilenameOfCurrentImage();
    // System.out.println(filenameOfCurrentImage + " is: " + img.getWidth() + "x" +
    // img.getHeight());
    StringTokenizer st = new StringTokenizer(filenameOfCurrentImage, ".");
    rgbDataMap.put(st.nextToken(), new FractionRgbData(img));
  }
  return rgbDataMap;
}

@Override
protected CommandExecutionResult executeArg(Map<String, RegexPartialMatch> arg) {

  final Set<EntityPortion> portion = getEntityPortion(arg.get("PORTION").get(0));

  final Set<VisibilityModifier> visibilities =
      EnumSet.<VisibilityModifier>noneOf(VisibilityModifier.class);
  final StringTokenizer st =
      new StringTokenizer(arg.get("VISIBILITY").get(0).toLowerCase(), " ,");
  while (st.hasMoreTokens()) {
    addVisibilities(st.nextToken(), portion, visibilities);
  }

  getSystem().hideOrShow(visibilities, arg.get("COMMAND").get(0).equalsIgnoreCase("show"));

  return CommandExecutionResult.ok();
}

public static IntegerRange parse(String s) throws ParseException {
  StringTokenizer st = new StringTokenizer(s, " \t,");
  if (st.countTokens() != 2) {
    throw new ParseException("Bad integer specification: " + s);
  }
  int from = Integer.parseInt(st.nextToken());
  int to = Integer.parseInt(st.nextToken());
  return new IntegerRange(from, to);
}

