protected boolean findInJavaLibraryPath(String libName) {
  String path = System.getProperty("java.library.path", "");
  StringTokenizer tok = new StringTokenizer(path, File.pathSeparator);
  while (tok.hasMoreTokens()) {
    path = tok.nextToken();
    if (findNativeLibrary(path, libName)) {
      return true;
    }
  }
  return false;
}

private static void initializeFromPreferences(
    EditorTextHoverDescriptor[] hovers, IPreferenceStore store) {
  String compiledTextHoverModifiers =
      store.getString(PreferenceConstants.EDITOR_TEXT_HOVER_MODIFIERS);
  StringTokenizer tokenizer = new StringTokenizer(compiledTextHoverModifiers, VALUE_SEPARATOR);
  HashMap<String, String> idToModifier = new HashMap<>(tokenizer.countTokens() / 2);
  while (tokenizer.hasMoreTokens()) {
    String id = tokenizer.nextToken();
    if (tokenizer.hasMoreTokens()) idToModifier.put(id, tokenizer.nextToken());
  }
  String compiledTextHoverModifierMasks =
      store.getString(PreferenceConstants.EDITOR_TEXT_HOVER_MODIFIER_MASKS);
  tokenizer = new StringTokenizer(compiledTextHoverModifierMasks, VALUE_SEPARATOR);
  HashMap<String, String> idToModifierMask = new HashMap<>(tokenizer.countTokens() / 2);
  while (tokenizer.hasMoreTokens()) {
    String id = tokenizer.nextToken();
    if (tokenizer.hasMoreTokens()) idToModifierMask.put(id, tokenizer.nextToken());
  }
  for (int i = 0; i < hovers.length; i++) {
    String modifierString = idToModifier.get(hovers[i].getId());
    boolean enabled = true;
    if (modifierString == null) modifierString = DISABLED_TAG;
    if (modifierString.startsWith(DISABLED_TAG)) {
      enabled = false;
      modifierString = modifierString.substring(1);
    }
    if (modifierString.equals(NO_MODIFIER)) modifierString = ""; // $NON-NLS-1$
    hovers[i].fModifierString = modifierString;
    hovers[i].fIsEnabled = enabled;
    hovers[i].fStateMask = computeStateMask(modifierString);
    if (hovers[i].fStateMask == -1) {
      // Fallback: use stored modifier masks
      try {
        hovers[i].fStateMask = Integer.parseInt(idToModifierMask.get(hovers[i].getId()));
      } catch (NumberFormatException ex) {
        hovers[i].fStateMask = -1;
      }
      // Fix modifier string
      int stateMask = hovers[i].fStateMask;
      if (stateMask == -1) hovers[i].fModifierString = ""; // $NON-NLS-1$
      else hovers[i].fModifierString = EditorUtility.getModifierString(stateMask);
    }
  }
}

/**
 * Returns the list of enabled cipher suites.
 *
 * @param helper The helper to use.
 * @return The list of enabled cipher suites.
 */
public static String[] getEnabledCipherSuites(RestletHelper<?> helper) {
  List<String> enabledCipherSuites = new ArrayList<String>();
  String[] enabledCipherSuitesParams =
      helper.getHelpedParameters().getValuesArray("enabledCipherSuites");
  for (String enabledCipherSuitesParam : enabledCipherSuitesParams) {
    StringTokenizer st = new StringTokenizer(enabledCipherSuitesParam);
    while (st.hasMoreElements()) {
      enabledCipherSuites.add(st.nextToken());
    }
  }
  return enabledCipherSuites.size() > 0 ? enabledCipherSuites.toArray(new String[0]) : null;
}

/**
 * Builds the GetCapabilitiesRequest according to the OGC WCS Specifications without a VERSION, to
 * get the highest version than a WCS supports.
 */
public static String buildCapabilitiesSuitableVersionRequest(String _host, String _version) {
  int index = _host.indexOf('?');

  if (index > -1) {
    String host = _host.substring(0, index + 1);
    String query = _host.substring(index + 1, _host.length());

    StringTokenizer tokens = new StringTokenizer(query, "&");
    String newQuery = "", token;

    // If there is a field or a value with spaces, (and then it's on
    // different tokens) -> unify them
    while (tokens.hasMoreTokens()) {
      token = tokens.nextToken().trim();

      if (token.toUpperCase().compareTo("REQUEST=GETCAPABILITIES") == 0) continue;

      if (token.toUpperCase().compareTo("SERVICE=WCS") == 0) continue;

      if ((_version != null) && (_version.length() > 0)) {
        if (token.toUpperCase().compareTo("VERSION=" + _version) == 0) continue;
      }

      if (token.toUpperCase().compareTo("EXCEPTIONS=XML") == 0) continue;

      newQuery += token + "&";
    }

    _host = host + newQuery;
  } else {
    _host += "?";
  }

  if ((_version != null) && (_version.compareTo("") != 0))
    _host += "REQUEST=GetCapabilities&SERVICE=WCS&VERSION=" + _version + "&EXCEPTIONS=XML";
  else _host += "REQUEST=GetCapabilities&SERVICE=WCS&EXCEPTIONS=XML";

  return _host.replaceAll(" ", "%20");
}

public void println() {
  StringTokenizer st = new StringTokenizer(s, "_");
  long sx = Long.parseLong(st.nextToken());
  long sy = Long.parseLong(st.nextToken());
  for (int y = 1; y <= 6; y++) {
    for (int x = 1; x <= 9; x++) {
      char c = '.';
      if (x == 6 && y == 4) c = 'S';
      if (x == 9 && y == 1) c = 'F';
      if (x == sx && y == sy) c = '*';
      System.out.print(c);
    }
    System.out.println();
  }
}

public CommandResponse doSITE_UNBAN(CommandRequest request) throws ImproperUsageException {

  if (!request.hasArgument()) {
    throw new ImproperUsageException();
  }

  StringTokenizer st = new StringTokenizer(request.getArgument());

  if (!st.hasMoreTokens()) {
    return StandardCommandManager.genericResponse("RESPONSE_501_SYNTAX_ERROR");
  }

  User myUser;
  try {
    myUser = GlobalContext.getGlobalContext().getUserManager().getUserByName(st.nextToken());
  } catch (Exception e) {
    logger.warn("", e);
    return new CommandResponse(200, e.getMessage());
  }

  myUser.getKeyedMap().setObject(UserManagement.BAN_TIME, new Date());
  myUser.getKeyedMap().setObject(UserManagement.BAN_REASON, "");

  myUser.commit();

  return StandardCommandManager.genericResponse("RESPONSE_200_COMMAND_OK");
}
